import './enterpriseService.scss';

const EnterpriseService = (): JSX.Element => {
    return (
        <div className="appService">
            <div className="appService__textWrapper">
                <h2>App development</h2>
                <span>Is a hybrid solution better then a native solution for your organisation? We can help you with building an App suited for your goals.</span> 
            </div>
        </div>
    );
}

export default EnterpriseService;
